<!DOCTYPE html>
<html>
<head>
	<meta charset="utf-8">
	<title>Contains Method</title>
	  <link rel="stylesheet" href="https://code.jquery.com/qunit/qunit-2.4.0.css">
</head>
<body>
  <div id="qunit"></div>
  <div id="qunit-fixture"></div>
  <script src="https://code.jquery.com/qunit/qunit-2.4.0.js"></script>
  <script src="./index.js"></script>
  <script>
  	'use strict'
  	QUnit.test('sample Method', function(assert) {
  	let numbers =[1,2,3,4,5,6];
   function number(){
    return 0.5 - Math.random()
   }
    var result = values(numbers, number)
    const result1 = result.slice(0, 4)
     console.log(result1)
  		assert.deepEqual(result1, result1)
  	})
  </script>
</body>
</html>
